 *
 * @since 0.2
 * @checkstyle ClassDataAbstractionCouplingCheck (2 lines)
 */
@SuppressWarnings({ "PMD.AvoidDuplicateLiterals", "PMD.TooManyMethods" })
class UploadEntityRequestTest {
    @Test
    void shouldThrowExceptionWhenDigestIsAbsent() {
        MatcherAssert.assertThat(Assertions.assertThrows(IllegalStateException.class, () -> new UploadEntity.Request(new RequestLine(RqMethod.PUT, "/v2/my-repo/blobs/uploads/123-abc?what=nothing").toString()).digest()).getMessage(), new StringContains(false, "Unexpected query"));
    }
}

